import { Link } from 'react-router-dom';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import ButtonGroup from '@material-ui/core/ButtonGroup';
import { createMuiTheme } from '@material-ui/core/styles';



export default function Header() {

  const useStyles = makeStyles(() => ({
    button: {
      display: 'inline-block',
      'margin-left': '5px',
      'margin-top': '15px',
    },
    nav_bar: {
      'display': 'flex',
      'justify-content': 'space-around',
      'background-color': '#333333',
      'min-height': '2vh',
      'background-image': 'linear-gradient(90deg, rgba(2,0,36,1) 0%, rgba(9,9,121,1) 38%, rgba(0,212,255,1) 100%);',
    }
  }));
  const classes = useStyles();

  const theme = createMuiTheme({
    palette: {
      primary: {
        light: '#757ce8',
        main: '#3f50b5',
        dark: '#002884',
        contrastText: '#fff',
      },
      secondary: {
        light: '#ff7961',
        main: '#f44336',
        dark: '#ba000d',
        contrastText: '#000',
      },
    },
  });

  const request = 'http://127.0.0.1:8000/rental_api/friends/1'; 
  const get_data = async () => {                         
    const response = await fetch(request);                                             
    const data = await response.json();
    console.log(data);
  };

  return (
    <nav className={classes.nav_bar}>
    <Link to="/">
      <Button className={classes.button} variant="contained" color="primary">Home</Button>
      </Link>
   	  	<ul>
   	  		<Link to="/tweet">
   	  			<Button className={classes.button} variant="contained" color="primary">Tweet</Button>
   	  		</Link>
   	  		<Link to="/news">
   	  			<Button className={classes.button} variant="contained" color="primary">News</Button>
   	  		</Link>
          <Link to="/recipe">
            <Button className={classes.button} variant="contained" color="primary">Recipes</Button>
          </Link>
          <Link to="/album">
            <Button className={classes.button} variant="contained" color="primary">Album</Button>
          </Link>
          <Link to="/checkout">
            <Button className={classes.button} variant="contained" color="primary">Checkout</Button>
          </Link>
   		 </ul>
        <ul>
            <Button className={classes.button} variant="contained" color="primary" onClick={() => {window.location.href = 'http://127.0.0.1:8000/api/v1/users'}}>Register</Button>
            <Button className={classes.button} variant="contained" color="primary" onClick={() => {window.location.href = 'http://127.0.0.1:8000/api/v1/token/login'}}>Log In</Button>
            <Button className={classes.button} variant="contained" color="primary" onClick={() => {window.location.href = 'http://127.0.0.1:8000/api/v1/users/me'}}>Profile</Button>
            <Button className={classes.button} variant="contained" color="primary" onClick={() => {window.location.href = 'http://127.0.0.1:8000/api/v1/token/logout'}}>Log Out</Button>
        </ul>
    </nav>
  );
}
